import React, { Component } from 'react'

export default class index extends Component {
    render() {
        const Date = [
            { id: '01', title: '消息01', title: '你好，我是廖家嘉' },
            { id: '02', title: '消息02', },
            { id: '03', title: '消息03' }
        ]
        return (
            <ul>
                <li>ID:</li>
                <li>TITLE:</li>
                <li>Message:</li>
            </ul>
        )
    }
}
